import { BrowserRouter as Router , Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './prueba';
import Prueba from './prueba2';
import { useNavigate } from 'react-router-dom';


function App() {
  const navigate = useNavigate();


  const handleLogin = () => {

    navigate('/home');
  };

  return (
    <div className="App">
    <Router>
      <Routes>
        <Route exact path="/" component = {Prueba}></Route>
        <Route path="/prueba" component = {Home}></Route>
      </Routes>
        <h1>Hola</h1>
        <button onClick={handleLogin}>
          ir a Prueba2
        </button>
    </Router>
    </div>
  )
}

export default App;
